function addStyles(css) {
    var styleElement = document.querySelector("head style") || document.createElement("style");
    
    if (styleElement.styleSheet) {
        styleElement.styleSheet.cssText += css;
    } else {
        styleElement.appendChild(document.createTextNode(css));
    }
    
    if (!styleElement.parentNode) {
        document.head.appendChild(styleElement);
    }

    return styleElement;
}

function removeStyles(css) {
    const styleSheets = document.querySelectorAll('style');

    styleSheets.forEach((styleElement) => {
        let cssText = '';
        if (styleElement.styleSheet) {
            cssText = styleElement.styleSheet.cssText;
        } else {
            cssText = styleElement.textContent;
        }

        if (cssText.includes(css)) {
            cssText = cssText.replace(css, '');
            if (styleElement.styleSheet) {
                styleElement.styleSheet.cssText = cssText;
            } else {
                styleElement.textContent = cssText;
            }

            if (cssText.trim() === '') {
                styleElement.remove();
            }
        }
    });
}

function showError(trueclick, error) {
    trueclick.getElementsByClassName('error')[0].innerHTML = error;
    trueclick.getElementsByClassName('error')[0].style.display = 'block';
}

function hideError(trueclick) {
    trueclick.getElementsByClassName('error')[0].style.display = 'none';
}

function showBoxError(box, error) {
    box.getElementsByClassName('error')[0].innerHTML = error;
    box.getElementsByClassName('error')[0].style.display = 'block';
}

function hideBoxError(box) {
    box.getElementsByClassName('error')[0].style.display = 'none';
}

document.addEventListener("DOMContentLoaded", function() {
    const isDarkReaderDetected = [...document.querySelectorAll('style')].some((el) => el.classList.contains('darkreader'));

    const trueclickBoxes = document.getElementsByClassName('trueclick');

    if (trueclickBoxes.length > 0) {
        addStyles(cssStyle);
    }

    for (var i = 0; i < trueclickBoxes.length; i++) {
        let trueclick = trueclickBoxes[i];
        let dataLanguage = trueclick.getAttribute('data-lang');
        let dataTheme = trueclick.getAttribute('data-theme');
        let dataCallback = trueclick.getAttribute('data-callback');

        if (dataLanguage == null) {
            dataLanguage = trueclick.getAttribute('data-language');
            if (dataLanguage == null) {
                dataLanguage = getNearestLanguage();
            }
        }

        if (dataTheme == null) {
            if (isDarkReaderDetected) {
                dataTheme = 'dark';
            } else if (trueclick.classList.contains('light')) {
                dataTheme = 'light';
            } else if (trueclick.classList.contains('dark')) {
                dataTheme = 'dark';
            }
        }

        addStyles(dataTheme === 'dark' ? cssStyleDark : dataTheme === 'light' ? cssStyleLight : cssStyleDefault);

        let boxHTML = html.replaceAll('FOOTER', translate(
            'Source code on <a href=\"https://github.com/tn3w/TrueClick\" target=\"_blank\">GitHub</a>', dataLanguage
        ));
        boxHTML = boxHTML.replaceAll('ROBOT', translate('I am not a robot.', dataLanguage));

        trueclick.innerHTML = boxHTML;

        let checkbox = trueclick.querySelector('input[type="checkbox"]');
        let svg = trueclick.querySelector('svg');

        function hideLoading() {
            checkbox.style.display = 'block';
            svg.style.display = 'none';
        }

        function showLoading() {
            checkbox.style.display = 'none';
            svg.style.display = 'block';
        }

        function executeCallback(callbackName) {
            if (typeof window[callbackName] === 'function') {
                window[callbackName]();
            }
        }

        let isVerified = false;
        let newData = null;
        let newError = null;
        let canContinue = false;

        function displayCaptcha(data) {
            if (newData != null) {
                data = newData;
            }

            var challenge = data.challenge;
            var original_image = challenge.original;
            var images = challenge.images;
            var dataset = data.dataset;

            var randomID = 'i' + Math.random().toString(36).substring(2, 15);
            var styles = captchaBoxCSS.replaceAll('ID', randomID);
            addStyles(styles);

            let overlay = document.createElement('div')
            overlay.id = randomID + '-overlay';
            
            let captchaBox = captchaBoxHTML;
            captchaBox = captchaBox.replaceAll('ORIGINAL_IMAGE', original_image);

            let caption = dataset == 'ai-dogs' ? translate('Choose the smiling dogs:', dataLanguage) : translate('Select all images that contain the same motif:', dataLanguage);
            captchaBox = captchaBox.replaceAll('CAPTION', caption);

            let grids = '';
            for (var i = 0; i < images.length; i++) {
                let gridItem = captchaGridItemHTML;
                let image = images[i];
                gridItem = gridItem.replaceAll('IMAGESRC', image.src);
                gridItem = gridItem.replaceAll('IMAGEID', image.id);
                grids += gridItem;
            }
            captchaBox = captchaBox.replaceAll('GRIDS', grids);

            overlay.innerHTML = captchaBox;

            document.body.appendChild(overlay);

            if (!(newError == null)) {
                showBoxError(overlay, newError);
                newError = null;
            }

            Array.from(document.body.children).forEach(child => {
                if (child !== overlay) {
                    child.classList.add('trueclick-blur');
                    child.addEventListener('click', function() {
                        overlay.remove();
                        Array.from(document.body.children).forEach(c => c.classList.remove('trueclick-blur'));
                        removeStyles(styles);
                    });
                }
            });
    
            overlay.addEventListener('click', function(event) {
                if (event.target === overlay) {
                    overlay.remove();
                    Array.from(document.body.children).forEach(child => child.classList.remove('trueclick-blur'));
                    removeStyles(styles);
                }
            });

            document.addEventListener('keydown', function(event) {
                if (event.key === 'Escape') {
                    overlay.remove();
                    Array.from(document.body.children).forEach(child => child.classList.remove('trueclick-blur'));
                    removeStyles(styles);
                }
            });

            let button = overlay.querySelector('.submit-button');
            button.addEventListener('click', function() {
                showLoading();
                let selected = Array.from(overlay.querySelectorAll('input[type="checkbox"]:checked'));
                selected = selected.map((checkbox) => checkbox.name);

                if (selected.length == 0) {
                    showBoxError(overlay.getElementsByClassName('captcha-box')[0], translate('You must select at least one image.', dataLanguage));
                } else if (selected.length < 2) {
                    showBoxError(overlay.getElementsByClassName('captcha-box')[0], translate('You have not selected all images.', dataLanguage));
                } else if (selected.length > 4) {
                    showBoxError(overlay.getElementsByClassName('captcha-box')[0], translate('You have selected too many images.', dataLanguage));
                } else {
                    hideBoxError(overlay.getElementsByClassName('captcha-box')[0]);
                    overlay.remove();
                    Array.from(document.body.children).forEach(c => c.classList.remove('trueclick-blur'));
                    removeStyles(styles);

                    fetch('/verify_trueclick_challenge', {
                        method: 'POST',
                        headers: {
                            'Content-Type': 'application/json'
                        },
                        body: JSON.stringify({
                            'id': challenge.id,
                            'token': challenge.token,
                            'selected': selected.join('')
                        })
                    })
                    .then(response => response.json())
                    .then(data => {
                        if (data.status === 'ok') {
                            isVerified = true;

                            let form = trueclick.closest('form') || document.forms[0];

                            let input = document.createElement('input');
                            input.type = 'hidden';
                            input.name = 'trueclick_response';
                            input.value = challenge.id + challenge.token;
                            form.appendChild(input);

                            canContinue = true;
                            hideLoading();

                            if (dataCallback != null) {
                                executeCallback(dataCallback);
                            }
                            return;

                        } else if (data.status === 'error') {
                            newData = data;
                            newError = translate('That was not the correct answer.', dataLanguage);
                        }

                        canContinue = true;
                        hideLoading();
                    });
                }
            });
        }

        checkbox.addEventListener('change', function() {
            if (this.checked) {
                showLoading();
                fetch('/create_trueclick_challenge', {
                    method: 'POST',
                    headers: {
                        'Content-Type': 'application/json'
                    }
                })
                .then(response => response.json())
                .then(async data => {
                    if (data.status === 'ok') {
                        hideLoading();

                        while (!isVerified) {
                            displayCaptcha(data);

                            while (!canContinue) {
                                await new Promise(r => setTimeout(r, 100));
                            }
                            canContinue = false;
                        }
                        this.checked = true;
                        this.disabled = true;
                        return;
                    } else if (data.status === 'error') {
                        showError(trueclick, data.error);
                    }
                    hideLoading();
                });
                this.checked = false;
            } else {
                hideLoading();
            }
        });
    }
});
